}

.circulo{

}
.txtCentro{

.invitado{
  position: absolute;
  bottom: 100px;
  width: 100%;
  font-family: ChampagneLimousines;
  font-size: 17px;
  padding: 5px;
}
.invitado>div{ padding: 5px; }
.txtsub2{
  display: flex;
  align-items: center;
  justify-content: center;
}
.txtSub{

  font-size: 40px;
}
.click{
  width: 150px;
  bottom: 20px;

  font-weight: 500;
  font-size: 60px;
  cursor: pointer;
}

.portada{
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100vh;
  opacity: 0;
}
.cuadrado{ 
  width: 100%;
  height: 99vh;
}

  top: 100px;

}

  top: 390px;

  color: rgb(212,192,154);
}
.dia{
  display: flex;
  justify-content: center;
  margin: 7px;
}
.num{
  font-size: 20px;
  padding-top: 5px;
  padding-bottom: 5px;
  margin-left: 10px;
  margin-right: 10px;
}
.cua{
  width: 70px;
  border-top: 1.5px rgb(212,192,154) solid;
  border-bottom: 1.5px rgb(212,192,154) solid;
  padding-top: 6px;
  padding-bottom: 0px;
}
.btnMenu{
  width: 100%;
  text-align: center;
  top: 500px;
}
.btnMenu>div{
  width: fit-content;
  font-family: ChampagneLimousines;
  font-size: 15px;
  cursor: pointer;
  margin: auto;
  margin-bottom: 15px;
  padding: 10px;
}
.dir{
  position: absolute;
  bottom: 1000px;
  left: 50%;
  transform: translateX(-50%);
  z-index: 100;
  width: 80%;
  font-family: ChampagneLimousines;
  font-weight: bolder;
  font-size: 18px;
  display: flex;
  justify-content: space-around;

  padding: 30px;
  color: rgb(255, 231, 153);

  transition: all 1s ease-in-out;

  width: 100px;

.gogleMap{

}
.closeUbi{
  position: absolute;
  right: 10px;
  top: 0px;

<script>
function animacionIn(){
  document.getElementById("intro").classList.add("difuninar")
  document.getElementById("portada").classList.add("aparecer")
}  
function link(l){
  localStorage.setItem("actCon",true)
  lnk(l)
}
function init_m(){
  let con = localStorage.getItem("actCon")
  if(con=="true"){
    document.getElementById("intro").style.display = "none"
    document.getElementById("portada").style.opacity = "1"
    document.getElementById("portada").style.zIndex = "20"
    setTimeout(()=>{ localStorage.setItem("actCon","") },1000)
  }
  let datos = document.getElementById("datos")
  localStorage.setItem("nom",datos.dataset.nom)
  localStorage.setItem("msa",datos.dataset.msa)
  localStorage.setItem("id",datos.dataset.id)
  document.getElementById("preload").style.display = "none"//preload

}
function ubicacion(){
	document.getElementById("dir").style.bottom = "100px"
}
function closeUbi(){
	document.getElementById("dir").style.bottom = "1000px"
}
</script>
